instances:
  mpox:
    schema:
      instanceName: "Mpox Virus"
      metadata:
        - name: collection_date
          type: date
          required: true
        - name: region
          type: string
          generateIndex: true
          autocomplete: true
          required: false 
        - name: country
          type: string
          generateIndex: true
          autocomplete: true
          required: false
        - name: isolate_name
          type: string
        - name: clade
          type: string
          generateIndex: true
          autocomplete: true
          required: false
      website:
        tableColumns:
          - country
          - collection_date
          - isolate_name
          - clade
      silo:
        dateToSortBy: date
        partitionBy: country
    referenceGenomes:
      nucleotideSequences:
        - name: "main"
          sequence: ""
